        // Find the middle node of the Linked List
        ListNode* slow = head, *fast = head, *temp;

        while(fast != NULL && fast->next != NULL) {
            temp = slow;
            slow = slow->next;
            fast = fast->next->next;
        }

        temp->next = NULL;      // End of 1st list

